if (int < int)
    return -1;
else if (int > int)
    return 1;

for ( ;  ; ) {
    int = org.eclipse.jgit.lib.Config.StringReader.read();
    if (int < 0)
        throw new org.eclipse.jgit.errors.ConfigInvalidException(org.eclipse.jgit.internal.JGitText.get().java.lang.String);

    if ('=' == int)
        break;

    if (((';' == int) || ('#' == int)) || ('\n' == int)) {
        org.eclipse.jgit.lib.Config.StringReader.reset();
        break;
    } 
    if ((' ' == int) || ('\t' == int))
        continue;

    throw new org.eclipse.jgit.errors.ConfigInvalidException(org.eclipse.jgit.internal.JGitText.get().java.lang.String);
